import React, { Component } from "react";
import { ReactRouter as Router, NavLink } from "react-router-dom";

class PageSidebar extends Component {
  logout = () => {
    // TODO: Fill in logout process here
  };

  render() {
    return (
      <Router>
        <div className="sidebar">
          {/* TODO: Fill in sidebar content here */}
          {/* New bug button  */}
          <NavLink to="/newBug" exact>
            <img
              src="icons/new-bug.png"
              alt="new bug icon"
              className="sidebar-icon"
              // onClick={() => navigate("/newBug")}
            />
          </NavLink>
          {/* home button  */}
          <NavLink to="/" exact>
            <img
              src="icons/home.png"
              alt="home icon"
              className="sidebar-icon"
              // onClick={() => navigate("/dashboard")}
            />
          </NavLink>
          {/* all projects button */}
          <NavLink to="/projects" exact>
            <img
              src="icons/projects-list.png"
              alt="project list icon"
              className="sidebar-icon"
              // onClick={() => navigate("/projects")}
            />
          </NavLink>
          {/* new project button */}
          <NavLink to="/newProject" exact>
            <img
              src="icons/new-project.png"
              alt="new project icon"
              className="sidebar-icon separator-icon"
              // onClick={() => navigate("/newProject")}
            />
          </NavLink>
          {/* settings button  */}
          <NavLink to="/settings" exact>
            <img
              src="icons/settings.png"
              alt="settings icon"
              className="sidebar-icon"
              // onClick={() => navigate("/settings")}
            />
          </NavLink>
          {/* logout button */}
          <img
            src="icons/logout.png"
            alt="logout icon"
            className="sidebar-icon btm-icon"
            onClick={() => this.logout()}
          />
        </div>
      </Router>
    );
  }
}

export default PageSidebar;
